import "./App.css";
import { Routes, Route, useParams } from "react-router-dom";
import Ateliers from "./pages/Ateliers";
import UsersPage from "./pages/Users";
import Action from "./pages/Action";

function App() {
  const params = useParams();
  return (
    <div className="w-screen h-screen flex justify-center items-center bg-igray flex-col space-y-28 scroll-smooth">
      <Routes>
        <Route path="/" element={<UsersPage />} />
        <Route path="/ateliers/:id" element={<Ateliers />} />
        <Route path="/ateliers/lavage/:id" element={<Action />} />
        <Route path="/ateliers/sechage/:id" element={<Action />} />
        <Route path="/ateliers/repassage/:id" element={<Action />} />
      </Routes>
    </div>
  );
}

export default App;
